import React from 'react'
import ReactDOM from 'react-dom'

const Hello = (name, age) => {
    return (
      <div>
        <p>Hello {name}</p>
        <p>Hello {age}</p>
      </div>
    )
  }

  const App = () => {
    return (
      <div>
        <h1>Greetings</h1>
        <Hello name="George" />
        <Hello age="16" />
      </div>
    )
  }

  ReactDOM.render(<App />, document.getElementById('root'))
